import JDictSelectTag from "../../components/dict/JDictSelectTag.vue";
import JSelectDepart from '@/components/jeecgbiz/JSelectDepart';
import JSelectUserByDep from '@/components/jeecgbiz/JSelectUserByDep';
import JSelectMultiUser from '@/components/jeecgbiz/JSelectMultiUser';
import JCheckbox from '@/components/jeecg/JCheckbox';
import JCodeEditor from '@/components/jeecg/JCodeEditor';
import JDate from '@/components/jeecg/JDate';
import JEditor from '@/components/jeecg/JEditor';
import JEllipsis from '@/components/jeecg/JEllipsis';
import JGraphicCode from '@/components/jeecg/JGraphicCode';
import JSlider from '@/components/jeecg/JSlider';
import JSelectMultiple from '@/components/jeecg/JSelectMultiple';
import JTreeDict from "../../components/jeecg/JTreeDict.vue";
import JCron from "@/components/jeecg/JCron.vue";
export default {
  name: 'SelectDemo',
  components: {
    JTreeDict: JTreeDict,
    JDictSelectTag: JDictSelectTag,
    JSelectDepart: JSelectDepart,
    JSelectUserByDep: JSelectUserByDep,
    JSelectMultiUser: JSelectMultiUser,
    JCheckbox: JCheckbox,
    JCodeEditor: JCodeEditor,
    JDate: JDate,
    JEditor: JEditor,
    JEllipsis: JEllipsis,
    JGraphicCode: JGraphicCode,
    JSlider: JSlider,
    JSelectMultiple: JSelectMultiple,
    JCron: JCron
  },
  data: function data() {
    return {
      selectList: [],
      selectedDepUsers: '',
      formData: {},
      form: this.$form.createForm(this),
      departId: '4f1765520d6346f9bd9c79e2479e5b12,57197590443c44f083d42ae24ef26a2c',
      userRealName: '',
      multiUser: '',
      jcheckbox: {
        values: 'spring,jeecgboot',
        options: [{
          label: 'Jeecg',
          value: 'jeecg'
        }, {
          label: 'Jeecg-Boot',
          value: 'jeecgboot'
        }, {
          label: 'Spring',
          value: 'spring',
          disabled: true
        }, {
          label: 'MyBaits',
          value: 'mybatis'
        }]
      },
      jcodedditor: {
        value: "function sayHi(word) {\n  alert(word)\n}\nsayHi('hello, world!')"
      },
      jdate: {
        value: '2019-5-10 15:33:06'
      },
      jeditor: {
        value: '<h2 style="text-align: center;">富文本编辑器</h2> <p>这里是富文本编辑器。</p>'
      },
      jellipsis: {
        value: '这是一串很长很长的文字段落。这是一串很长很长的文字段落。这是一串很长很长的文字段落。这是一串很长很长的文字段落。'
      },
      jgraphicCode: {
        value: ''
      },
      jslider: {
        value: false
      },
      jselectMultiple: {
        options: [{
          text: '字符串',
          value: 'String'
        }, {
          text: '整数型',
          value: 'Integer'
        }, {
          text: '浮点型',
          value: 'Double'
        }, {
          text: '布尔型',
          value: 'Boolean'
        }],
        value: 'Integer,Boolean'
      },
      modal: {
        title: '这里是标题',
        visible: false,
        width: '100%',
        style: {
          top: '20px'
        },
        fullScreen: true
      },
      cron: ''
    };
  },
  computed: {
    nameList: function nameList() {
      var names = [];

      for (var a = 0; a < this.selectList.length; a++) {
        names.push(this.selectList[a].name);
      }

      return names;
    }
  },
  methods: {
    handleChange: function handleChange() {},
    getDepartIdValue: function getDepartIdValue() {
      return this.form.getFieldValue('departId');
    },
    selectOK: function selectOK(data) {
      this.selectList = data;
    },
    handleSelect: function handleSelect() {
      this.$refs.selectDemoModal.add();
    },
    selectReset: function selectReset() {
      this.selectList = [];
    },
    //通过组织机构筛选选择用户
    onSearchDepUser: function onSearchDepUser() {
      this.$refs.JSearchUserByDep.showModal();
      this.selectedDepUsers = '';
      this.$refs.JSearchUserByDep.title = '根据部门查询用户';
    },
    onSearchDepUserCallBack: function onSearchDepUserCallBack(selectedDepUsers) {
      this.selectedDepUsers = selectedDepUsers;
    },
    generateCode: function generateCode(value) {
      this.jgraphicCode.value = value.toLowerCase();
    },
    handleJSliderSuccess: function handleJSliderSuccess(value) {
      this.jslider.value = value;
    },

    /** 切换全屏显示 */
    handleClickToggleFullScreen: function handleClickToggleFullScreen() {
      var mode = !this.modal.fullScreen;

      if (mode) {
        this.modal.width = '100%';
        this.modal.style.top = '20px';
      } else {
        this.modal.width = '1200px';
        this.modal.style.top = '50px';
      }

      this.modal.fullScreen = mode;
    },
    setCorn: function setCorn(data) {
      var _this = this;

      this.$nextTick(function () {
        _this.form.cronExpression = data;
      });
    }
  }
};
